import MainHeader from "./Header";
import './Common.css';
import SideTab from "./SideTab";
import GenerateBill from "../Product/GenerateBill"

const MasterLanding = () => {
    return (
        <div className="divheight">
            <MainHeader />
            <div>
                <SideTab />
                <GenerateBill></GenerateBill>
            </div>
            
        </div>
    );
}
export default MasterLanding;
